import React from "react";
import { Age } from "./Age";

export class Welcome extends React.Component {
  render() {
    return (
      <div>
        {(this.props.name="John" && <p>Welcome, {this.props.name}</p>)}
        <Age age={30} />
      </div>
    );
  }
}

// Setting default value for props
Welcome.defaultProps = {
  name: "User",
};


export default function App() {
  const str = 'hi';

  return (
    <div>
      {str.length === 2 ? (
        <>
          <h2>First</h2>
          <h2>Second</h2>
        </>
      ) : null}
    </div>
  );
}
